import { Box, IconButton, Toolbar, Typography } from "@mui/material";
import { navbarLinks, socialLinks } from "../../database/NavbarData";
import AOS from "aos";
import "aos/dist/aos.css";
import { useEffect } from "react";
import { Link } from "react-router-dom";

const Footer = () => {
  useEffect(() => {
    AOS.init();
  }, []);
  return (
    <div data-aos="zoom-out-up" data-aos-duration="5000">
      <Box className="bg-[#304FA1]">
        <Toolbar
          sx={{
            paddingY: "80px",
            alignItems: "unset !important",
            color: "#fff",
          }}
        >
          <div style={{ flex: 8, padding: 5 }}>
            <Typography
              variant=""
              fontSize={"clamp(1.5rem, 3vw, 2rem)"}
              data-aos="zoom-out-right"
              data-aos-duration="5000"
            >
              It's Time to Pull in a{" "}
              <span style={{ fontWeight: 600 }}>Professional</span>
            </Typography>
          </div>
          <div style={{ flex: 4, padding: 5 }}>
            <Typography
              variant="h6"
              data-aos="zoom-out-up"
              data-aos-duration="5000"
            >
              Menu
            </Typography>
            <div>
              {navbarLinks.map((data, i) => (
                <Link key={i} to={data.to} style={{display: 'block'}} data-aos="zoom-out-up" data-aos-duration="5000">
                  {data.name}
                </Link>
              ))}
            </div>
          </div>
          <div style={{ flex: 5, padding: 5 }}>
            <Typography
              variant="h5"
              data-aos="zoom-out-left"
              data-aos-duration="5000"
            >
              Contact
            </Typography>
            <Typography
              variant="h6"
              data-aos="zoom-out-left"
              data-aos-duration="5000"
            >
              <Link to={"mailto:info@solxraf.com"}>info@solxraf.com</Link>
            </Typography>
            <Typography
              variant="h6"
              data-aos="zoom-out-left"
              data-aos-duration="5000"
            >
              <Link to={"tel:+923041395525"}>+ (92) 304 1395525</Link>
            </Typography>
            <div style={{ display: "flex" }}>
              {socialLinks.map((data, i) => (
                <IconButton
                  size="small"
                  data-aos="zoom-out-left"
                  data-aos-duration="5000"
                >
                  {data.icon}
                </IconButton>
              ))}
            </div>
          </div>
        </Toolbar>
        <Toolbar
          sx={{
            backgroundColor: "#0002",
            height: "100px",
            paddingX: "50px !important",
          }}
        >
          <Typography variant="" sx={{ fontWeight: 600, color: "#fff" }}>
            &copy; SolXraf. All Rights Reserved
          </Typography>
        </Toolbar>
      </Box>
    </div>
  );
};

export default Footer;
